import React, { Component } from 'react';
import { Link } from "react-router-dom"
import { Menu } from "../../components"
import "./style.css"


class Nav extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    shouldComponentUpdate(lastProp, nextProp) {
        console.log("props: ", this.props);
        console.log("lastProp: ", lastProp);
        if (lastProp.statusLogin !== this.props.statusLogin)
            return true
        return false
    }

    render() {
        return (
            <div className="nav-container">
                <Link to="/">
                    <Menu text="Home"
                        class="first"
                        style={{ borderWidth: 0, paddingLeft: 0 }}
                    />
                </Link>
                <Link to="/product">
                    <Menu text="Product" goToPage={() => this.props.changePage("product")} />
                </Link>

                {/* checking is login true */}
                { this.props.statusLogin ?
                    <Menu text="Logout" goToPage={this.props.changeLogIn} />
                    :
                    <>
                        <Link to="/login">
                            <Menu text="Login" goToPage={() => this.props.changePage("login")} />
                        </Link>
                        <Link to="/daftar">
                            <Menu text="Daftar" goToPage={() => this.props.changePage("daftar")} />
                        </Link>
                    </>
                }
            </div>
        );
    }
}

export default Nav
